import React from 'react';
import s from './Users.module.css';


const Users = (props) => {
    let users = props.users.map((u) => <div key={u.id}>{u.fullName}
        <span></span>
        <span></span>
    </div>);
    return (
        <div>
            {users}
        </div>
    )
}

export default Users;
